/** Root Subscription for Real-Time Updates */
export type Subscription = {
  __typename?: 'Subscription';
  /** Subscribe to message read status changes */
  messageRead?: Maybe<MessageReadEvent>;
  /** Subscribe to all messages sent to the authenticated user */
  myMessages?: Maybe<MessageEvent>;
  /** Subscribe to all order updates for the authenticated user */
  myOrderUpdates?: Maybe<OrderStatusEvent>;
  /** Subscribe to all sample updates for the authenticated user */
  mySampleUpdates?: Maybe<SampleStatusEvent>;
  /** Subscribe to new messages for a specific order or sample conversation */
  newMessage?: Maybe<MessageEvent>;
  /** Subscribe to new notifications for the authenticated user */
  newNotification?: Maybe<NotificationEvent>;
  /** Subscribe to notification read status changes */
  notificationRead?: Maybe<NotificationReadEvent>;
  /** Subscribe to quotes for orders */
  orderQuoteReceived?: Maybe<OrderQuoteEvent>;
  /** Subscribe to order shipment updates */
  orderShipped?: Maybe<OrderShippedEvent>;
  /** Subscribe to order status changes */
  orderStatusChanged?: Maybe<OrderStatusEvent>;
  /** Subscribe to production stage updates */
  productionStageUpdated?: Maybe<ProductionStageEvent>;
  /** Subscribe to production status changes */
  productionStatusChanged?: Maybe<ProductionStatusEvent>;
  /** Subscribe to manufacturer quotes for samples */
  sampleQuoteReceived?: Maybe<SampleQuoteEvent>;
  /** Subscribe to sample shipment updates */
  sampleShipped?: Maybe<SampleShippedEvent>;
  /** Subscribe to sample status changes */
  sampleStatusChanged?: Maybe<SampleStatusEvent>;
};


